import React, { useState } from 'react';

const TravelSearchInterface = () => {
  const [fromLocation, setFromLocation] = useState('');
  const [toLocation, setToLocation] = useState('');
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const airports = ['SFO', 'ATL', 'LAX', 'STL', 'PVG', 'MSP', 'NRT'];

  const destinations = [
    {
      image: "/api/placeholder/500/300?text=Shanghai",
      title: "The Bund, Shanghai",
      description: "China's most international city",
      price: 598
    },
    {
      image: "/api/placeholder/500/300?text=Sydney",
      title: "Sydney Opera House, Sydney",
      description: "Take a stroll along the famous harbor",
      price: 981
    },
    {
      image: "/api/placeholder/500/300?text=Kyoto",
      title: "Kodaiji Temple, Kyoto",
      description: "Step back in time in the Gion district",
      price: 633
    },
    {
      image: "/api/placeholder/1200/600?text=Tsavo",
      title: "Tsavo East National Park, Kenya",
      description: "Named after the Tsavo River, and opened in April 1984, Tsavo East National Park is one of the oldest parks in Kenya. It is located in the semi-arid Taru Desert.",
      price: 1248,
      isWide: true
    }
  ];


  return (


    <div className="container-fluid vh-100 d-flex flex-column justify-content-center align-items-center" 
        style={{
            backgroundImage: "url('/banner.png')",
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundRepeat: 'no-repeat',
            height: '100vh'
        }}

         >
      <div className="text-center mb-4">
        <h1 className="display-4" style={{color: '#4a5fff'}}>
          It's more than<br/>just a trip
        </h1>
      </div>
      
      <div className="card shadow-lg" style={{width: '600px'}}>
        <div className="card-body p-4">
          <form>
            <div className="row g-3">
              <div className="col-md-6 position-relative">
                <div className="form-floating">
                  <input 
                    type="text" 
                    className="form-control" 
                    id="fromLocation"
                    placeholder="From where?"
                    value={fromLocation}
                    onFocus={() => setDropdownOpen(true)}
                    onBlur={() => setTimeout(() => setDropdownOpen(false), 200)}
                    onChange={(e) => setFromLocation(e.target.value)}
                  />
                  <label htmlFor="fromLocation">From where?</label>
                  
                  {dropdownOpen && (
                    <ul className="list-group position-absolute w-100 mt-1 shadow-sm" style={{zIndex: 1000}}>
                      {airports
                        .filter(airport => 
                          airport.toLowerCase().includes(fromLocation.toLowerCase())
                        )
                        .map((airport) => (
                          <li 
                            key={airport} 
                            className="list-group-item list-group-item-action"
                            onMouseDown={() => {
                              setFromLocation(airport);
                              setDropdownOpen(false);
                            }}
                          >
                            {airport}
                          </li>
                        ))
                      }
                    </ul>
                  )}
                </div>
              </div>
              
              <div className="col-md-6">
                <div className="form-floating">
                  <input 
                    type="text" 
                    className="form-control" 
                    id="toLocation"
                    placeholder="Where to?"
                    value={toLocation}
                    onChange={(e) => setToLocation(e.target.value)}
                  />
                  <label htmlFor="toLocation">Where to?</label>
                </div>
              </div>
              
              <div className="col-md-6">
                <div className="form-floating">
                  <input 
                    type="text" 
                    className="form-control" 
                    id="dates"
                    placeholder="Depart - Return"
                  />
                  <label htmlFor="dates">Depart - Return</label>
                </div>
              </div>
              
              <div className="col-md-6">
                <div className="form-floating">
                  <input 
                    type="text" 
                    className="form-control" 
                    id="passengers"
                    placeholder="1 adult"
                    defaultValue="1 adult"
                  />
                  <label htmlFor="passengers">Passengers</label>
                </div>
              </div>
              
              <div className="col-12">
                <button 
                  type="submit" 
                  className="btn btn-primary w-100 py-3"
                  style={{backgroundColor: '#4a5fff', borderColor: '#4a5fff'}}
                >
                  Search
                </button>
              </div>
            </div>
          </form>

          <div className="container-fluid px-4 py-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2 className="m-0">Find your next adventure with these rides deals</h2>
        <a href="#" className="text-decoration-none">All â†’</a>
      </div>
      
      <div className="row g-4">
        {destinations.map((dest, index) => (
          <div 
            key={index} 
            className={`${dest.isWide ? 'col-12' : 'col-md-4'} position-relative`}
          >
            <div className="card border-0 overflow-hidden shadow-sm">
              <img 
                src={dest.image} 
                className="card-img-top" 
                alt={dest.title}
                style={{
                  height: dest.isWide ? '400px' : '250px', 
                  objectFit: 'cover'
                }}
              />
              <div className="card-body p-3">
                <h5 className="card-title mb-1">{dest.title}</h5>
                <p className="card-text text-muted small mb-2">{dest.description}</p>
                <div className="d-flex justify-content-between align-items-center">
                  <span className="fw-bold text-primary">${dest.price}</span>
                  <button className="btn btn-sm btn-outline-primary">Book Now</button>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
        </div>
      </div>
    </div>
  );
};

export default TravelSearchInterface;
